import React from 'react'
import Layout from '../Layout'
import {Box,Card, CardActionArea , CardMedia} from "@mui/material"
import MenuList from '../../Data/Data'

function Menu() {
  return (
    <Layout>
        <Box>
          {
            MenuList.map(menu => (
              <Card>
                  <CardActionArea>
                    <CardMedia sx={{minHeight:"400px"}} component={'img'} src={menu.image} alt=''/>
                  </CardActionArea>
              </Card>
            ))
          }
        </Box>
    </Layout>
  )
}

export default Menu
